import React, { Component } from "react";
import { Link } from 'react-router-dom'

import GlobalStyle from '../../styles/global';
import { App, Container, Content } from './styles';

class PsycAcess extends Component {
    render() {
        return (
            <App>
                <nav class="navbar navbar-light bg-light">
                    <h4 class="navbar float-center">HOME</h4>
                    <h1> </h1>
                </nav>
            
                <Container>
                    <Content>
                        <form> 
                            <h1>Controles</h1>
                        
                            <Link to="/Kids">
                                <button type="submit" class="button button-info btn-lg btn-block float-center">Crian√ßas</button>
                            </Link>

                            <Link to="/Activities">
                                <button type="submit" class="button button-info btn-lg btn-block float-center">Atividades</button>
                            </Link>
                        </form>
                    </Content>
                    <GlobalStyle />
                </Container>
            </App>                
        )
    }
}
export default PsycAcess;
